import React from "react";
import styled from "styled-components";

const Wrapper = styled.header`
	background-color: #24262b;
	padding: 15px 50px;
	display: flex;
	align-items: center;
`;

const Header = () => {
	return (
		<Wrapper>
			<a href="/">
				<img src="/logo.png" alt="logo" height="px" />
			</a>
			<button>button</button>
		</Wrapper>
	);
};

export default Header;
